// this line should not be removed
var wcDemoGetClaims = angular.module("wcDemoGetClaims",[]);

wcDemoGetClaims.controller( "wcDemoGetClaimsController", function( $scope ) {

    var dq = new DataQuery( 'qcDemoGetSubClaims' );
    dq.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.claims = dq.getData().data;
    		});
    	});


    $scope.adaptForAccordion = function() {
        var resp = [];
        var index = 1;

        $scope.usersAccordion = $scope.claims.forEach(function(item) {
            odd = index % 2;
            alert(item.id);
            resp.push({
                'label' :'Claim #'+id,
                'disabled': false,
                'open': (index>1 ? false : true),
                'classes': (odd ? 'info-odd' : 'info-even'),
                'link': 'http://abc.com/data/users/' + item.id + '/',
                'content': {
                    'id': item.id,
                    'summary': item.summary,
                    'region': item.region,
                    'amount': item.amount 
                    }
                });
            index++;
        });

        $scope.claimsAccordion = resp;
        return '';
    };


    $scope.adaptForAccordion();




});
